var func_menu_first_pointer = 0;
var func_menu_render_num = 30;
var func_menu_step = 1;
var func_menu_list_len = func_menu_list.length;
function initFuncMenu() {
    $(".menu-list").css({
        "display":"flex"
    })
    for (let i = func_menu_first_pointer; i < func_menu_render_num + func_menu_first_pointer; i++) {
        renderFuncMenu(func_menu_list[i]);
    }
}

function set_func_menu_first_pointer(){
    for(let i =0;i<func_menu_list_len;i++){
        if(func_menu_list[i].func_name == func_name){
            func_menu_first_pointer = i;
        }
    }
}


function renderFuncMenu(data) {
    if (data == null) {
        return;
    }
    let btn_div = document.createElement("div");
    btn_div.className = "btn-div";

    let f_btn = document.createElement("button");
    f_btn.className = "btn btn-func btn-primary-" + data.func_id;
    let onclick_name = data.func_alias.replace("_", "");

    f_btn.setAttribute('onclick', onclick_name + "(this,'" + data.func_id + "','" + data.func_name + "')")
    f_btn.setAttribute('id',data.func_name)

    let btn_inner = document.createElement("div");
    btn_inner.className = "btn-inner";

    let span_div = document.createElement("div");
    let span_f = document.createElement("span");
    span_f.innerHTML = data.func_alias.split("_")[0];
    let span_l = document.createElement("span");
    span_l.innerHTML = data.func_alias.split("_")[1];

    span_div.appendChild(span_f);
    span_div.appendChild(span_l);

    btn_inner.innerHTML = data.svg_1
    btn_inner.appendChild(span_div);
    f_btn.appendChild(btn_inner);
    btn_div.appendChild(f_btn);
    $(".main .menu-list .btn-group").append(btn_div);
    $(".menu-list .btn-group .btn-div button").on('mouseover', function () {
        $(this).find('svg').css({
            "fill": "#fff"
        });
    })
    $(".menu-list .btn-group .btn-div button").on('mouseout', function () {
        if ($(this).find('svg').attr('class') != 'funcIcon-active') {
            $(this).find('svg').css({
                "fill": "#b9baba"
            });
        }
    })
    $(".menu-list .btn-group .btn-div button").on('click', function () {
        menuButtonActive(this)
    })
}

